function chooseImageComplete(){
    $('#points-selection-screen').prop('style').display = 'block';
    $('#firstScreen').prop('style').display = 'none';
    loadApp();
}

function displaySelectionImagesScreen(){
    $('#firstScreen').prop('style').display = 'block';
    $('#points-selection-screen').prop('style').display = 'none';
}

function readURL(input, fileTarget) {
    if (input.files && input.files[0]) {
        var reader = new FileReader();

        reader.onload = function (e) {
            $('#'+fileTarget)
                .attr('src', e.target.result);
            $('#'+fileTarget+'-store')
                .attr('src', e.target.result);
        };
        reader.onloadend = function (e) {	
        };

    reader.readAsDataURL(input.files[0]);
	//reader.readAsDataURL(target);
	//var aa=0;
    }
}	


var layer1 = document.getElementById('layer1');
var layer2 = document.getElementById('layer2');
var layers = [layer1, layer2];

var container1 = document.getElementById('container1');
var container2 = document.getElementById('container2');
var containers = [container1, container2];

var canvas1 = document.getElementById('canvas1');
var canvas2 = document.getElementById('canvas2');
var canvases = [canvas1, canvas2];

var context1 = canvas1.getContext('2d');
var context2 = canvas2.getContext('2d');
var contexts = [context1, context2];

var imageObj1 = new Image();
var imageObj2 = new Image();

var points1 = [];
var points2 = [];

var users = [];

function loadApp(){
    
    function setUsers(){
       users = [{userID:1,
                     layer:layer1,
                     container:container1,
                     canvas:canvas1,
                     context:context1,
                     image:imageObj1,
                     points:points1},
                {userID:2,
                     layer:layer2,
                     container:container2,
                     canvas:canvas2,
                     context:context2,
                     image:imageObj2,
                     points:points2}];

        users[0].image.onload = function () {
            initUserCanvas(users[0]);
            resize();
        }
        users[1].image.onload = function () {
            initUserCanvas(users[1]);
            resize();
        }
		if(using_sample){
			//ADD IF TO SELECT THE CORRECT EXAMPLE
			
			var sel = document.getElementById('selectSample');
	
			if(sel.value=="sample_1"){
				users[0].image.src = document.getElementById('myImga').children[0].src;
				users[1].image.src = document.getElementById('myImgb').children[0].src;
				
				
			}else if(sel.value=="sample_2"){
				users[0].image.src = document.getElementById('myImga2').children[0].src;
				users[1].image.src = document.getElementById('myImgb2').children[0].src;
			}
			else if(sel.value=="sample_3"){
				users[0].image.src = document.getElementById('myImga3').children[0].src;
				users[1].image.src = document.getElementById('myImgb3').children[0].src;
			}
			else if(sel.value=="sample_4"){
				users[0].image.src = document.getElementById('myImga4').children[0].src;
				users[1].image.src = document.getElementById('myImgb4').children[0].src;
			}
			
		}else{
			users[0].image.src = document.getElementById('img1').src;
			users[1].image.src = document.getElementById('img2').src;
		}
       // users[0].image.src = document.getElementById('myImg').children[0].src;
        //users[1].image.src = document.getElementById('img2').src;
    }

    setUsers();

    var points = [points1, points2];

    var currentPoint = 0;

    var colors = ['white','blue','fuchsia','red','yellow','lime'];

    var instructions = ['Please select the epipole in image #1', 
                        'Please select p1 in image #1.', 
                        'Please select corresponding point to p1 in image #2',
                        'Please select p2 in image #1', 
                        'Please select corresponding point to p2 in image #2',
                        'Please select p3 in image #1', 
                        'Please select corresponding point to p3 in image #2',
                        'Please select p4 in image #1', 
                        'Please select corresponding point to p4 in image #2',
                        'Please select p5 in image #1',
                        'Please select corresponding point to p5 in image #2',
                        'Please Click Next to find your buddy.', ''];

    var N_PAIRS = 5;

    function next(){
        getLayer().style.display = 'none';
        currentPoint = Math.min(N_PAIRS*2, currentPoint+1);
        getLayer().style.display = 'block';
        updateFrameColor();
        updateInstructionSpan();
    }

    function back(){
        getLayer().style.display = 'none';
        currentPoint = Math.max(0, currentPoint-1);
        getLayer().style.display = 'block';
        updateFrameColor();
        updateInstructionSpan();
    }

    function getCurrentUser(){
        if (currentPoint == 0) return users[0];
        return users[(currentPoint+1) % 2];
    }

    function getLayer(){
        return getCurrentUser().layer;
    }

    function getContainer(){
        return getCurrentUser().container;
    }

    function getCanvas(){
        return getCurrentUser().canvas;
    }

    function getContext(){
        return getCurrentUser().context;
    }

    function getColorName(){
        if (currentPoint == 0) return colors[0];
        return colors[Math.floor((currentPoint+1)/2)];
    }

    function updateFrameColor() {
        getContainer().style.backgroundColor = getColorName();
    }

    function updateInstructionSpan(msg) {
        if (_.isUndefined(msg)) {
            $('#instruction').html(instructions[currentPoint]);   
        } else {
            $('#instruction').html(msg);
        }
    }

    function getPointsArr(){
        if (currentPoint == 0) return points[0];
        return points[(currentPoint+1) % 2];
    }

    // convert point number to its index in the matching points array.
    function pointIdx(point_num){ 
        if (point_num % 2 == 0) return Math.max(0, point_num / 2 - 1);
        else return (point_num + 1) / 2;
    }

    // this function fill an image on canvas
    function drawImage(image, canvas_id) {
        canvas_id = canvas_id - 1;
        contexts[canvas_id].drawImage(image, 0, 0, image.width, image.height, 0, 0, canvases[canvas_id].width, canvases[canvas_id].height);
    }

    function initUserCanvas(user){
        user.canvas.width = user.image.width;
        user.canvas.height = user.image.height;
        drawImage(user.image, user.userID);
    }

    // set this to false to maintain the canvas aspect ratio, or true otherwise
    var stretch_to_fit = false;
    var widthToHeight = 0;

    function resize() {
        var navbarHeight = document.getElementById('#navbar').offsetHeight;

        // aspect ratio
        var widthToHeight = getCanvas().width / getCanvas().height;
        var newWidthToHeight = widthToHeight;

        // cache the window dimensions (discount the border)
        var newWidth = window.innerWidth,
            newHeight = window.innerHeight - navbarHeight;

        if (stretch_to_fit) {
            // overwrite the current canvas aspect ratio to fit the entire screen
            widthToHeight = window.innerWidth / (window.innerHeight - navbarHeight);
        } else {
            newWidthToHeight = newWidth / newHeight;
        }

        // scale the container using CSS		
        if (newWidthToHeight > widthToHeight) {
            newWidth = newHeight * widthToHeight;
            getContainer().style.height = newHeight + 'px';
            getContainer().style.width = newWidth + 'px';
        } else {
           newHeight = newWidth / widthToHeight;
           getContainer().style.width = newWidth + 'px';
           getContainer().style.height = newHeight + 'px';
        }

        // adjust the container position   
        getContainer().style.marginTop = (-newHeight / 2 + (navbarHeight /2)) + 'px';
        getContainer().style.marginLeft = (-newWidth / 2) + 'px';

    };

    // listen to resize events
    window.addEventListener('resize', function () { resize(); }, false);

    // also resize the screen on orientation changes
    window.addEventListener('orientationchange', function () { resize(); }, false);

    var radius = 20;
    var lineWidth = 5;
    var putPoint = function(e){

        var rect = getCanvas().getBoundingClientRect();
        var pos = getTouchPosition(getCanvas(), e);
        if (getPointsArr().length - 1 == pointIdx(currentPoint)){
            undo();
        }

        getPointsArr().push(_.extend(pos, {colorName:getColorName()}));
        drawPoint(getContext(), pos, getColorName());
    }

    function getTouchPosition(canvas, mouseEvent){
        var rect = canvas.getBoundingClientRect();

        var canvas_visible_height = (rect.bottom - rect.top);
        var canvas_visible_width = (rect.right - rect.left);

        var scale_x = canvas.width / canvas_visible_width;
        var scale_y = canvas.height / canvas_visible_height;

        var x_draw = (mouseEvent.clientX - rect.left) * scale_x;
        var y_draw = (mouseEvent.clientY - rect.top) *  scale_y;

        return {x:x_draw, y:y_draw};
    }

    users[0].canvas.addEventListener('mousedown', putPoint);
    users[1].canvas.addEventListener('mousedown', putPoint);

    var undo = function() {
        // case no points were selected, go back to previous screen
        if (users[0].points.length == 0) {
            displaySelectionImagesScreen();
        }

        // case current state is the last step.
        if (currentPoint == N_PAIRS * 2){
            $('#next-btn').removeAttr('disabled');
        }

        // case no point has been selected yet, in the current step
        if (getPointsArr().length - 1 < pointIdx(currentPoint)){
            back();
            resize();
        }
        else {
            getPointsArr().pop();    
        }
        
        // Redraw current state:
        drawImage(imageObj1,1);
        drawImage(imageObj2,2);

        drawPoints()
    };
    
    document.getElementById('back-btn').addEventListener('click', undo , false);
    
    document.getElementById('next-btn').addEventListener('click', function () {
        if (currentPoint == N_PAIRS * 2){
            $('#next-btn').attr('disabled', 'disabled');
            epipole2 = findBuddy(points1, points2);
                console.log(epipole2);
                context = context2;
                p = {x:epipole2.x, y:epipole2.y};
                console.log(p);
                context = getContext();
                context.beginPath();
                context.arc(p.x, p.y, radius, 0, Math.PI*2);
                context.lineWidth = 5;
                context.strokeStyle = 'white';
                context.stroke();
                updateInstructionSpan("Here's you'r buddy!");
     
        }
        else{
            next();
            resize();
            drawPoints();
        }
    }, false);

    function drawPoints(){
       for (i = 0; i < getPointsArr().length; i++){
           context = contexts[(i == 0) ? 0 : (i+1) % 2];
           drawPoint(context, getPointsArr()[i], getPointsArr()[i].colorName);
       }
    }

    function drawPoint(context, p, color){
        context = getContext();
        context.beginPath();
        context.arc(p.x, p.y, radius, 0, Math.PI*2);
        context.lineWidth = lineWidth;
        context.strokeStyle = p.colorName;
        context.stroke();
    }
}

