 function getConic(e1_,e2_,p11_,p12_,p21_,p22_,p31_,p32_,p41_,p42_,q11_,q12_,q21_,q22_,q31_,q32_,q41_,q42_)
 {
	//The conics are was symolically as described in the paper. 4 points + epipole in one image corresponds to a conic in the second image.
	c11=conic11(e1_,e2_,p11_,p12_,p21_,p22_,p31_,p32_,p41_,p42_,q11_,q12_,q21_,q22_,q31_,q32_,q41_,q42_);
	c12=conic12(e1_,e2_,p11_,p12_,p21_,p22_,p31_,p32_,p41_,p42_,q11_,q12_,q21_,q22_,q31_,q32_,q41_,q42_);
	c13=conic13(e1_,e2_,p11_,p12_,p21_,p22_,p31_,p32_,p41_,p42_,q11_,q12_,q21_,q22_,q31_,q32_,q41_,q42_);
	c22=conic22(e1_,e2_,p11_,p12_,p21_,p22_,p31_,p32_,p41_,p42_,q11_,q12_,q21_,q22_,q31_,q32_,q41_,q42_);
	c23=conic23(e1_,e2_,p11_,p12_,p21_,p22_,p31_,p32_,p41_,p42_,q11_,q12_,q21_,q22_,q31_,q32_,q41_,q42_);
	c33=conic33(e1_,e2_,p11_,p12_,p21_,p22_,p31_,p32_,p41_,p42_,q11_,q12_,q21_,q22_,q31_,q32_,q41_,q42_);
	lalo("C=[[c11,c12,c13];[c12 ,c22, c23];[c13, c23 ,c33]]");
	return C;
 }
 

function findBuddy(arr1, arr2) {
    var epipole = [parseInt(_.first(arr1).x), parseInt(_.first(arr1).y)];
    var points = [arrangeArray(_.tail(arr1)), arrangeArray(arr2)];
    var content = {"epipole": epipole, "corresponding_points": points};
   	a1=points[1][0][1];
	a2=points[1][0][0];
	a3=points[1][1][1];
	a4=points[1][1][0];
	a5=points[1][2][1];
	a6=points[1][2][0];
	a7=points[1][3][1];
	a8=points[1][3][0];
	a9=points[1][4][1];
	a10=points[1][4][0];
	ee1=epipole[0];
	ee2=epipole[1];
	
	//The homography H transforms the first 3 points to [1 0 0 ],[0 1 0 ],[0 0 1 ]	
	lalo("X=[[0 ,0, 0 ,-1, 0 ,0,a1 ,0, 0 ]; [1, 0, 0,0,0,0,  -a2 ,0,0];[0 ,0, 0 ,0, -1 ,0,0,a3 , 0 ]; [0, 1, 0,0,0,0,  0 ,-a4,0];[0 ,0, 0 ,0, 0 ,-1,0,0,a5  ]; [0, 0, 1,0,0,0,  0 ,0,-a6]]")
	lalo("a = nullspace(X)")
	lalo("H=inv(reshape(a[:,2],3,3))")
	
	//The calculate the two conics that passes through the unknown epipole 
	C1=getConic(ee1,ee2,points[1][0][0],points[1][0][1],points[1][1][0],points[1][1][1],points[1][2][0],points[1][2][1],points[1][3][0],points[1][3][1],points[0][0][0],points[0][0][1],points[0][1][0],points[0][1][1],points[0][2][0],points[0][2][1],points[0][3][0],points[0][3][1]);
	C2=getConic(ee1,ee2,points[1][0][0],points[1][0][1],points[1][1][0],points[1][1][1],points[1][2][0],points[1][2][1],points[1][4][0],points[1][4][1],points[0][0][0],points[0][0][1],points[0][1][0],points[0][1][1],points[0][2][0],points[0][2][1],points[0][4][0],points[0][4][1]);
	
	//Transforming the conics to the coordinates system where the 3 common points are [1 0 0 ],[0 1 0 ],[0 0 1 ]
	lalo("C1T=inv(H)'*C1*inv(H)");
	lalo("C2T=inv(H)'*C2*inv(H)");
	
	//The two conics are of the form: ayz+bxz+cxy=0
	//So they are actually lines in the coordinates [yz,xz,xy] ~ [1/x,1/y,1/z] 
 	//Since the two lines passes through the epipole, the intersection of the lines is the reciprocal epipole [1/ex,1/ey,1/ez]	
	ep=lalo("nullspace([[C1T[1,2];C1T[0,2];C1T[0,1]];[C2T[1,2];C2T[0,2];C2T[0,1]]])")
	
	//Extracting the epipole by the reciprocal its coordinate
	epdone=lalo("[ep[1]*ep[2],ep[0]*ep[2],ep[1]*ep[0]]'");
	
	//transforming the epipole back to the image coordinates
	epimage=lalo("inv(H)*epdone'")
	
	//Canceling the projective depth
	lalo("epimx=epimage[0]/epimage[2]")
	lalo("epimy=epimage[1]/epimage[2]")
	var result={x:epimx,y:epimy};
	return result;
}


function arrangeArray(arr) {
    ret = _.map(arr, function (a) {
        if (!a) return undefined;
        return [parseInt(a.x), parseInt(a.y)];
    });
    // console.log(ret);
    return ret;
}

